import React, { Component, ReactNode } from 'react'
import Layout from './Layout';

interface IProps {
    children: ReactNode;
    // any other props that come into the component
    IMG: any
  }

function IMG ({IMG} : IProps) {
   

const IMGs = IMG;

console.log(IMGs)

     
        return (
            <div>
                <Layout>
            <div className="flex mt-10 flex-row">
                
      {IMGs.map((art:any ) => (
          <div className="w3-card w3-round-large mx-2 ">
          <img className=" object-cover " src={art.urls.full}/>  
      <Link href={art.links.html}><a target="_blank"><button className="m-2 w3-button w3-round-xlarge bg-gray-500 w3-red">Download</button></a></Link>
          </div>
         
       
        ))}
        
         
            </div>
            </Layout>
            <style jsx>
                {
                    `
                    img{
                        width:150px;
                        height:200px
                    }
                    `
                }
            </style>
            </div>
        )
    
}


export default IMG

export async function getServerSideProps () {

    const API = await fetch ("https://api.unsplash.com/photos/?client_id=KkBgR-UR5bzc26yPltIXqo_Jsd5f-h2Hv_rL4zzpG2k")

    const IMG = await API.json();

    return{
        props :{
           IMG,
        }
    }
    
}
